import { useState, useEffect } from "react";
import LineChart from "./LineChart";
import axios from 'axios';
import Combobox from "react-widgets/Combobox";
import 'chartjs-plugin-zoom';
import Hammer from "hammerjs";

function BuyingCard() {
  const[neighborhood, setNeighborhood]=useState([
      "Barajevo", 
      "Cukarica", 
      "Grocka", 
      "Lazarevac",
      "Mladenovac",
      "Novi Beograd",
      "Obrenovac",
      "Palilula",
      "Rakovica",
      "Savski venac",
      "Sopot",
      "Stari grad",
      "Surcin",
      "Vozdovac",
      "Vracar",
      "Zemun",
      "Zvezdara"
  ]);
  const roomCount=['0.5', '1.0', '1.5', '2.0', '2.5', '3.0', '3.5', '4.0', '4.5', '5.0'];
  const[historicalPrices, setHistoricalPrices]=useState([]);
  const [forecast, setForecast] = useState([]);
  const [lowerBoundForecast, setLowerBoundForecast] = useState([]);
  const [upperBoundForecast, setUpperBoundForecast] = useState([]);
  const [flag,setFlag] = useState(false);
  const [forecastChartData, setForecastChartData] = useState({});
  const [upperBoundChartData, setUpperBoundChartData] = useState({});
  const [lowerBoundChartData, setLowerBoundChartData] = useState({});
  const [showChart, setShowChart] = useState(false);
  const [isCheckedHistoricalData, setIsCheckedHistoricalData] = useState(false);

  const [realEstateData, setRealEstateData] = useState({
      location:'',
      roomCount:'',
  });
  
  function forecastPrice (e){
      // console.log(realEstateData)
      e.preventDefault();
      axios.post('https://localhost:44338/api/PriceAnalyser/forecast', realEstateData)
          .then((res)=>{
              setHistoricalPrices(res.data.historicalData);
              setForecast(res.data.forecast);
              setUpperBoundForecast(res.data.upperBoundForecast);
              setLowerBoundForecast(res.data.lowerBoundForecast);
          })
          .then(()=>{
            setShowChart(true);
            setFlag(!flag);
          })
  }

  useEffect(() => {
    isCheckedHistoricalData? setForecastChartData({...historicalPrices,...forecast}) : setForecast(forecast);
    // setChartData({...historicalPrices, ...forecast});
    
    setLowerBoundChartData(lowerBoundForecast);
    setUpperBoundChartData(upperBoundForecast);
  }, [flag]);

  const handleChangeHistoricalData= () =>{
    setIsCheckedHistoricalData(true)
  }

  var data = {
  labels: Object.entries(forecastChartData).map(([key,value]) => key),
  datasets: [
    {
      label: "Prosečna cena nekretnina",
      data: Object.entries(forecastChartData).map((value) => value),
      backgroundColor: [
        "rgba(75,192,192,1)",
        // "#ecf0f1",
        // "#50AF95",
        // "#f3ba2f",
        // "#2a71d0",
      ],
      borderColor: "black",
      borderWidth: 2,
    },
    {
      label: "Gornja granica",
      data: Object.entries(upperBoundChartData).map((value) => value),
      backgroundColor: [
        // "rgba(75,192,192,1)",
        // "#ecf0f1",
        // "#50AF95",
        // "#f3ba2f",
        "#2a71d0",
      ],
      borderColor: "green",
      borderWidth: 2,
      fill:'-1'
      
    },
    {
      label: "Donja granica",
      data: Object.entries(lowerBoundChartData).map((value) => value),
      backgroundColor: [
        // "rgba(75,192,192,1)",
        // "#ecf0f1",
        // "#50AF95",
        // "#f3ba2f",
        "#2a71d0",
      ],
      borderColor: "red",
      borderWidth: 2,
      fill:'1'
    },
  ],
}

var options = {
  // maintainAspectRatio: false,
  scales: {
    x: {
      ticks: {
        // For a category axis, the val is the index so the lookup via getLabelForValue is needed
        callback: function(val, index) {
          // Hide every 2nd tick label
          return index % 4 === 0 ? this.getLabelForValue(val) : '';
        }
      },
    },
    y:{
      title:{
        display:true,
        text:'Prosečna cena po m2',
        minRotation:90
        }
    }
  },
  legend: {
    labels: {
      fontSize: 25,
    },
  },
  plugins: {
    zoom: {
      zoom: {
        wheel: {
          enabled: true // SET SCROOL ZOOM TO TRUE
        },
        mode: "x",
        speed: 1
      },
      pan: {
        enabled: true,
        mode: "x",
        speed: 1
      }
    }
  }
}


return (
  <div>
      <form className="inputForm">
      <div>
                  <label>Naselje</label>
                  <Combobox
                      defaultValue=""
                      data={neighborhood}
                      onChange={(value)=> realEstateData.location=value}
                      placeholder="Izaberite naselje"
                      style={{marginBottom:20}}
                      aria-required = 'true'
                  />
              </div>
              <div>
                  <label>Broj soba</label>
                  <Combobox
                      defaultValue=""
                      data={roomCount}
                      placeholder="Izaberite broj soba"
                      onChange={value=>realEstateData.roomCount=value}
                      style={{marginBottom:20}}
                      aria-required = 'true'
                  />
              </div>
              <input id="checkHistoricalData" type="checkbox" className={isCheckedHistoricalData ? "checkedHistoricalData":""} checked={isCheckedHistoricalData} onChange={handleChangeHistoricalData}></input>
              <label htmlFor='checkedDomacin'>Prikaži kretanje cena prethodnih godina</label>
              <button onClick={forecastPrice} className="btnForecast">
                      Predvidi cenu
                </button>
      </form>
      {showChart ?
  <div className="graphContainer">
    <div style={{ width: '80%', height:500 }}>
      <LineChart chartData={data} options={options} widt={"100%"} height={"100%"} />
    </div>
    
  </div>:null
  }
  </div>
);
}

export default BuyingCard;
